(1, 1, 'pl', '2012-10-30 12:23:31', 39, 'natychmiast', 1, 'SMTP -> ERROR: MAIL not accepted from server: 553 adres ktorego uzywasz "info@superwebsite.pl" nie jest Twoim adresem, posiadane przez Ciebie adresy to: darkduke@wp.pl', 'info@superwebsite.pl', 'SuperWebsite.pl', NULL, 'a:1:{s:31:"konrad.rudowski@supertraders.pl";s:12:"Magda Lepper";}', '', '', '', 'Informacje o opiekunie projektu', '<table border="0" cellpadding="0" cellspacing="0" style="font: 12px Arial Narrow, arial; margin-left:auto; margin-right:auto;" width="630">\r\n <tbody>\r\n  <tr>\r\n   <td colspan="3">\r\n    <a href="http://www.superwebsite.pl"><img alt="" height="128" src="http://www.supertraders.pl/_public/temp/mailSwTop.png" style="border:0px;" width="630" /></a></td>\r\n  </tr>\r\n  <tr>\r\n   <td colspan="3">\r\n    <div style="text-align:left; float:left; color:#5A5A5A; padding: 30px 0px 40px 28px; width: 575px;">\r\n     <p>\r\n Witamy,</p>\r\n<p>\r\n Informujemy, że za realizację Państwa strony internetowej odpowiada Michał Rachwał (michal.rachwal@m-media.pl), z którym mogą się Państwo kontaktować w przypadku jakichkolwiek pytań lub wątpliwości dotyczących realizowanego projektu.</p>\r\n<p>\r\n Na adres mailowy opiekuna projektu należy kierować również wszystkie maile zawierające materiały potrzebne do wykonania Państwa strony internetowej. Prosimy, by w tytule maili zawierających materiały na stronę WWW podali Państwo również nazwę swojej firmy.</p>\r\n<p align="right" style="text-align: right;">\r\n Pozdrawiamy,<br />\r\n Zespół SuperWebsite</p>\r\n</div>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td colspan="3">\r\n    <div style="border-bottom:1px solid #ffae00; width:585px; margin:3px 22px;">\r\n     &nbsp;</div>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td colspan="2">\r\n    <p style="font-size: 10px; color: #6E6E6E; float:left; width:480px; margin-left: 22px;">\r\n     Mail wysłany przez portal SuperWebsite. Wiadomość może zawierać informacje o charakterze poufnym. Jeżeli nie jest Pan/Pani zamierzonym adresatem niniejszej korespondencji, prosimy o poinformowanie nadawcy o jej otrzymaniu oraz niezwłoczne usunięcie treści wiadomości z komputera.</p>\r\n   </td>\r\n   <td>\r\n    <img alt="" height="42" src="http://www.supertraders.pl/_public/temp/logo_mmedia_mail.png" width="107" /></td>\r\n  </tr>\r\n  <tr>\r\n   <td width="325">\r\n    &nbsp;</td>\r\n   <td width="181">\r\n    &nbsp;</td>\r\n   <td width="144">\r\n    &nbsp;</td>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n', 'Witamy,\r\nInformujemy, że za realizację Państwa strony internetowej odpowiada Michał Rachwał (michal.rachwal@m-media.pl), z którym mogą się Państwo kontaktować w przypadku jakichkolwiek pytań lub wątpliwości dotyczących realizowanego projektu.\r\nNa adres mailowy opiekuna projektu należy kierować również wszystkie maile zawierające materiały potrzebne do wykonania Państwa strony internetowej. Prosimy, by w tytule maili zawierających materiały na stronę WWW podali Państwo również nazwę swojej firmy.\r\n\r\nPozdrawiamy,\r\nZespół SuperWebsite\r\n\r\n-------------------------------------------------------------\r\nMail wysłany przez portal SuperWebsite. Wiadomość może zawierać informacje o charakterze poufnym. Jeżeli nie jest Pan/Pani zamierzonym adresatem niniejszej korespondencji, prosimy o poinformowanie nadawcy o jej otrzymaniu oraz niezwłoczne usunięcie treści wiadomości z komputera.', '', '/var/www/supetraders2/temp/public/email_zalaczniki/39/');
