(6, 1, 'pl', '2012-01-31 15:34:16', 'lista testowa zmiana kategorii', 'Informacje o zmianach na portalu SuperTraders.pl (test)', 'Szanowni Państwo,\r\n Informujemy, iż w ostatnim czasie na portalu SuperTraders.pl zaszedł szereg zmian. Zmiany te wynikały z uwag, jakie otrzymaliśmy od Państwa oraz od użytkowników Internetu odwiedzających profile Państwa Firm.\r\n W dniu 05.01.2012r. połączyliśmy na wszystkich subdomenach opisy firm z zakładek „Strona główna” oraz „O firmie”, dzięki czemu użytkownicy Internetu mogą zapoznać się z pełnym opisem Państwa Firmy w jednym miejscu. Zmiana ta wynikała z uwag, jakie otrzymywaliśmy od użytkowników, którzy syganzlizowali nam, że rozmieszczenie opisu firmy w dwóch zakładkach utrudnia poruszanie się po portalu i zapoznawanie się z obecnymi na nim firmami oraz ich ofertą.\r\n W dniu dzisiejszym z kolei (31.01.2012r.) wprowadziliśmy na portal nowe drzewa kategorii produktów i usług, jak również nową listę branż. Zmiana ta jest odpowiedzią na Państwa uwagi i sugestie. W dotychczasowej komunikacji ze Specjalistami z Biura Obsługi Klienta sygnalizowali nam Państwo, że obecne na portalu SuperTraders.pl drzewa kategorii są zbyt rozbudowane i w dużej liczbie przypadków niedostosowane do Państwa oferty. Reagując na te uwagi, zdecydowaliśmy się na budowę nowych drzew oraz na przypisanie do nich obecnych na portalu produktów i usług.\r\n Z wszystkimi wprowadzonymi zmianami mogą Państwo zapoznać się odwiedzając portal SuperTraders.pl. Na wszystkie uwagi i sugestie związane z nowymi drzewami kategorii czekamy pod adresem uwagi@supertraders.pl.', '<p>\r\n Szanowni Państwo,<br />\r\n &nbsp;&nbsp; &nbsp;Informujemy, iż w ostatnim czasie na portalu SuperTraders.pl zaszedł szereg zmian. Zmiany te wynikały z uwag, jakie otrzymaliśmy od Państwa oraz od użytkownik&oacute;w Internetu odwiedzających profile Państwa Firm.<br />\r\n &nbsp;&nbsp; &nbsp;W dniu 05.01.2012r. połączyliśmy na wszystkich subdomenach opisy firm z zakładek &bdquo;Strona gł&oacute;wna&rdquo; oraz &bdquo;O firmie&rdquo;, dzięki czemu użytkownicy Internetu mogą zapoznać się z pełnym opisem Państwa Firmy w jednym miejscu. Zmiana ta wynikała z uwag, jakie otrzymywaliśmy od użytkownik&oacute;w, kt&oacute;rzy syganzlizowali nam, że rozmieszczenie opisu firmy w dw&oacute;ch zakładkach utrudnia poruszanie się po portalu i zapoznawanie się z obecnymi na nim firmami oraz ich ofertą.<br />\r\n &nbsp;&nbsp; &nbsp;W dniu dzisiejszym z kolei (31.01.2012r.) wprowadziliśmy na portal nowe drzewa kategorii produkt&oacute;w i usług, jak r&oacute;wnież nową listę branż. Zmiana ta jest odpowiedzią na Państwa uwagi i sugestie. W dotychczasowej komunikacji ze Specjalistami z Biura Obsługi Klienta sygnalizowali nam Państwo, że obecne na portalu SuperTraders.pl drzewa kategorii są zbyt rozbudowane i w dużej liczbie przypadk&oacute;w niedostosowane do Państwa oferty. Reagując na te uwagi, zdecydowaliśmy się na budowę nowych drzew oraz na przypisanie do nich obecnych na portalu produkt&oacute;w i usług.<br />\r\n &nbsp;&nbsp; &nbsp;Z wszystkimi wprowadzonymi zmianami mogą Państwo zapoznać się odwiedzając portal SuperTraders.pl. Na wszystkie uwagi i sugestie związane z nowymi drzewami kategorii czekamy pod adresem <a href="mailto:uwagi@supertraders.pl">uwagi@supertraders.pl</a>.<br />\r\n &nbsp;</p>', '/www/st/temp/private/mailingi/6/doWysylki.csv', '2012-01-31 15:35:00', 6, 6, 0, NULL, '2012-01-31 15:40:00', 'SuperTraders.pl', 'www@supertraders.pl', 1, 1),
