(15, 1, 'pl', '2012-07-19 13:44:54', 'testWierzytelność', 'testWierzytelność', 'awartość strony, kiedy ten chce zobaczyć sam jej wygląd. Jedną z mocnych stron używania Lorem Ipsum jest to, że ma wiele różnych „kombinacji” zdań, słów i akapitów, w przeciwieństwie do zwykłego: „tekst, tekst, tekst”, sprawiającego, że wygląda to „zbyt czytelnie” po polsku. Wielu webmasterów i designerów używa Lorem Ipsum jako domyślnego modelu tekstu i wpisanie w internetowej wyszukiwarce ‘lorem ipsum’ spowoduje znalezienie bardzo wielu stron, które wciąż są w budowie. Wiele wersji tekstu ewoluowało i zmieniało się przez lata, czasem przez przypadek, czasem specjalnie (humorystyczne wstawki itd).', '<p>\r\n <span style="color:#ff0000;"><u><strong><span style="font-family: Arial, Helvetica, sans; font-size: 11px; line-height: 14px; text-align: justify; ">awartość strony, kiedy ten chce zobaczyć sam jej wygląd. Jedną z mocnych stron używania Lorem Ipsum jest to, że ma wiele różnych &bdquo;kombinacji&rdquo; zdań, słów i akapitów, w przeciwieństwie do zwykłego: &bdquo;tekst, tekst, tekst&rdquo;, sprawiającego, że wygląda to &bdquo;zbyt czytelnie&rdquo; po polsku. Wielu webmasterów i designerów używa Lorem Ipsum jako domyślnego modelu tekstu i wpisanie w internetowej wyszukiwarce &lsquo;lorem ipsum&rsquo; spowoduje znalezienie bardzo wielu stron, które wciąż są w budowie. Wiele wersji tekstu ewoluowało i zmieniało się przez lata, czasem przez przypadek, czasem specjalnie (humorystyczne wstawki itd).</span></strong></u></span></p>', '/www/st/temp/private/mailingi/15/doWysylki.csv', '2012-07-19 13:50:00', 4, 4, 0, NULL, '2012-07-19 13:55:00', 'SuperTraders.pl', 'www@supertraders.pl', 1, 1),
